import "./TradeItem.css";

function TradeItem() {

const date = new Date(2023, 2, 21);
const ticker = 'OLX';
const name = 'Orignal Low X';
const pnl = 45;


  return (
    <div className="trade-item">
      <div>{date.toDateString()}</div>
      <div className="trade-item__description">
        <h2>${name}</h2>
        <h2>${ticker}</h2>
        <div className="trade-item__pnl">${pnl}</div>
      </div>
    </div>
  );
}

export default TradeItem;
